          <section className="sect red cf">
              <LeftInformations />
              {/* <SmallImagesect margin="left"/> */}
          </section>
      )
    }
}


  // small image + article
  class SmallImagesect extends Component {
    render() {
      const marginStyle = this.props.margin;
      const newClassName = marginStyle + 'margin flt_left smallAdImageWrap'

      return (
        <div className={newClassName}>
            <article>lorem ipsum..</article> 
            <div>디자인 요소입니다</div>      

            <div className="smallAdImage">small image part</div>
        </div>
      )
    }
  }


// Big image
class LeftInformations extends Component {
  _login_Cart() {
    const selection = ['Sign in', 'Cart'];
    const selectionArr = [];

    for ( const name in selection) {
      // console.log('<p>' + selection[name] + '</p>')
      selectionArr.push(
        `<p className="ractBox">
          <a href="/">
          <span className="_skip">{selection[name]}</span>
          </a>
        </p>`
      )
      // return(

