                  <p className="membership"><a href="/">MemberShip</a></p>
                </div>
              </div>
              <div className="cf">
                <p className="ractBox flt_left"></p>
                <p className="ractBox flt_left"><a href="/">Buy Now</a></p>
                <p className="viewMore flt_left"><a href="/">View More</a></p>
